// import { FaHome, FaUsers, FaFileContract, FaWallet } from "react-icons/fa";
import { NavLink } from "react-router-dom";
// import {Link} from 'react-router-dom';
import styles from "./Sidebar.module.css";

const Sidebar = () => {
  return (
    <div className={styles.sidebar}>

      <NavLink to="/" className={({ isActive }) => (isActive ? styles.active : "")}>
        Home
      </NavLink>
      <NavLink to="/dashboard" className={({ isActive }) => (isActive ? styles.active : "")}>
        Dashboard
      </NavLink>
      <NavLink to="/loan-application" className={({ isActive }) => (isActive ? styles.active : "")}>
      Loan Application
      </NavLink>

      <NavLink to="/aboutus" className={({ isActive }) => (isActive ? styles.active : "")}>
      About Us
      </NavLink>

      <NavLink to="/contactus" className={({ isActive }) => (isActive ? styles.active : "")}>
      Contact Us
      </NavLink>

      <NavLink to="/user" className={({ isActive }) => (isActive ? styles.active : "")}>
      Contact Us
      </NavLink>


      {/* <ul>
        <li><a href="#"><FaHome /> Dashboard</a></li>
        <li><a href="#"><FaUsers /> Borrowers <span className="badge">1</span></a></li>
        <li><a href="#"><FaFileContract /> Loan Types <span className="badge">2</span></a></li>
        <li><a href="#"><FaWallet /> Wallets <span className="badge">2</span></a></li>
      </ul> */}
    </div>
  );
};

export default Sidebar;
